webpackJsonp([0xf99a6eb763e5],{722:function(e,t){e.exports={data:{site:{siteMetadata:{title:"weiran.co",author:"Weiran Zhang"}},markdownRemark:{id:"/Users/weiran/git/weiran/weiran.co/src/pages/blog/2013/2/why-doesnt-anybody-copy-apple/index.md absPath of file >>> MarkdownRemark",html:"<blockquote>\n<p>Tim Cook refers to integration and a great team as unique Apple advantages (but also note the references to magic and belief.) It’s a better explanation but it is still hard to understand why nobody copies this approach. Integration is something that can take a long time, but it is possible with a Herculean effort. A few companies are starting to make moves in that direction (e.g. Microsoft.) But efforts are half-hearted. There is no “move the Earth” panic to become an integrated company from Samsung, Google or Microsoft.</p>\n</blockquote>",frontmatter:{title:"Why doesn’t anybody copy Apple?",date:"February 19, 2013",passthroughUrl:"http://www.asymco.com/2013/02/19/why-doesnt-anybody-copy-apple/"}}},pathContext:{slug:"/blog/2013/2/why-doesnt-anybody-copy-apple/",previous:{fields:{slug:"/blog/2013/2/the-real-problem-with-bing/"},frontmatter:{title:"The real problem with Bing",passthroughUrl:"http://www.slate.com/blogs/moneybox/2013/02/15/scroogled_and_mark_penn_the_political_consultant_is_lame_but_he_s_not_bing.html",type:null}},next:{fields:{slug:"/blog/2013/2/innovation/"},frontmatter:{title:"'Innovation'",passthroughUrl:"http://ihkdesigns.wordpress.com/2013/02/19/idiots-are-everywhere/",type:null}}}}}});
